import React, {Component} from 'react'; 

const CaseDivider = styled.h1`
    background-color: ${props => props.color};
`;


const Divider = ( {title} ) => {

  return(
    <CaseDivider color = {color}> {title} </CaseDivider>

  )
}

export default Divider;
